import React from 'react'


export const MyComponent = props => {
  // JSX -> DOM node
  const [myName, setmyName] = React.useState('John Doe')
  return (
    <>
      <h4>{myName}</h4>
      <input type="text" value={myName} 
      onChange={(e) => setmyName(e.target.value)}>
        
      </input>
    </>
  )
}
